export default function CoinHistory({ coin, time, content, status }) {
    return (
        <div className="itemhistory">
            {
                status === 'da-ket-thuc' ? <span className="badge b1">Đã kết thúc</span> :
                    (
                        status === 'dang-dien-ra' ? <span className="badge b2">Đang diễn ra</span> :
                            <span className="badge b3">Sắp diễn ra</span>
                    )

            }
            <div className="td"><span className="coin red">{coin}</span></div>
            <div className="td">{time}</div>
            <div className="td">{content}</div>
            <div className="td">{status}</div>
        </div>
    )
}
